//------------------------------调试参数处理------------------------------
// 用于调试的参数(为了作区分,这里的标头起始字母用小写处理, 同时使用下划线命名法)
uint8 image_thre = 120;                // 边线处理的初始阈值
uint8 image_begin_x = IMAGE_WIDTH / 2; // 边线处理的起始x坐标偏离中心的距离
uint8 image_begin_y = 100;             // 边线处理起始的y坐标
uint8 image_block_size = 7;            // 区域二值化的区域边长
uint8 image_block_clip_value = 4;      // 修正的经验参数(一般为2~5)

/**
 * @brief                   获取图像数据
 * @param image             图片
 * @param x                 像素点的x坐标
 * @param y                 像素点的y坐标
 * @return                  像素点的灰度值
 */
uint8 IMAGE_AT(uint8 *image, int16 x, int16 y)
{
    return *(image + y * IMAGE_WIDTH + x);
}

/**
 * @brief                   迷宫巡线 - 自动二值化处理
 * @param image             图片
 * @param block_size        自适应二值化区域长度(必须为奇数)
 * @param clip_value        二值化修正值(经验值,一般为2-5)
 * @param x                 边线(初始)x坐标
 * @param y                 边线(初始)y坐标
 * @return                  无
 * @example                 Image_FindLine_LeftHand_Adaptive(image, image_block_size, image_block_clip_value, x1, y1);
 */

static void Image_FindLine_LeftHand_Adaptive(uint8 Image_iptsLeft[][2], uint8 *image, uint8 block_size, int8 clip_value, uint8 x, uint8 y)
{
    // 传入的块的长度必须为奇数!
    int8 half = block_size / 2;
    uint8 step = 0;
    uint8 dir = 0, turn = 0;
    while (step < Image_iptsLeftNum && half < x && x < IMAGE_WIDTH - half - 1 && half < y && y < IMAGE_HEIGHT - half - 1 && turn < 4)
    {
        // 使用自适应阈值法求解阈值
        // clip_value为经验常数,一般取2~5
        int16 localThres = 0;
        for (int16 dy = -half; dy <= half; ++dy)
        {
            for (int16 dx = -half; dx <= half; ++dx)
            {
                localThres += IMAGE_AT(image, x + dx, y + dy);
            }
        }
        localThres /= block_size * block_size;
        localThres -= clip_value;

        // 做阈值判断
        uint8 frontValue = IMAGE_AT(image, x + Image_dir_front[dir][0], y + Image_dir_front[dir][1]);
        uint8 frontLeftValue = IMAGE_AT(image, x + Image_dir_frontLeft[dir][0], y + Image_dir_frontLeft[dir][1]);

        if (frontValue < localThres)
        {
            // 前方是黑色"墙壁" -- 向右转
            // 方向改变,记录转向一次
            // 向右转是 顺时针 - 所以要(+1)%4处理
            dir = (dir + 1) % 4;
            ++turn;
        }
        else if (frontLeftValue < localThres)
        {
            // 前方是白色,但是左前方是"黑色" - 这种情况就是直道走
            x += Image_dir_front[dir][0];
            y += Image_dir_front[dir][1];
            Image_iptsLeft[step][0] = x;
            Image_iptsLeft[step][1] = y;
            ++step;
            turn = 0;
        }
        else
        {
            // 前方是白色,同时左前方也是"白色" - 这种情况下说明需要向左转弯"贴墙走"
            x += Image_dir_frontLeft[dir][0];
            y += Image_dir_frontLeft[dir][1];
            // 向左转是 逆时针 - 所以要(+3)%4处理 (或者说(-1)%4处理)
            dir = (dir + 3) % 4;
            Image_iptsLeft[step][0] = x;
            Image_iptsLeft[step][1] = y;
            ++step;
            turn = 0;
        }
    }
    Image_iptsLeftNum = step;
}

/**
 * @brief                   迷宫巡线 - 自动二值化处理
 * @param image             图片
 * @param block_size        自适应二值化区域长度(必须为奇数)
 * @param clip_value        二值化修正值(经验值,一般为2-5)
 * @param x                 边线(初始)x坐标
 * @param y                 边线(初始)y坐标
 *                          作用:1.防止边线过长数据溢出
 *                              2.边线较短的时候改变num,防止外部访问到"非法"数据
 * @return                  无
 * @example                 Image_FindLine_RightHand_Adaptive(image, image_block_size, image_block_clip_value, x2, y2);
 */
static void Image_FindLine_RightHand_Adaptive(uint8 Image_iptsRight[][2], uint8 *image, uint8 block_size, uint8 clip_value, uint8 x, uint8 y)
{
    // 传入的块的长度必须为奇数!
    uint8 half = block_size / 2;
    uint8 step = 0;
    uint8 dir = 0, turn = 0;
    while (step < Image_iptsRightNum && half < x && x < IMAGE_WIDTH - half - 1 && half < y && y < IMAGE_HEIGHT - half - 1 && turn < 4)
    {
        // 使用自适应阈值法求解阈值
        // clip_value为经验常数,一般取2~5
        int16 localThres = 0;
        for (int16 dy = -half; dy <= half; ++dy)
        {
            for (int16 dx = -half; dx <= half; ++dx)
            {
                localThres += IMAGE_AT(image, x + dx, y + dy);
            }
        }
        localThres /= block_size * block_size;
        localThres -= clip_value;

        // 做阈值判断
        uint8 frontValue = IMAGE_AT(image, x + Image_dir_front[dir][0], y + Image_dir_front[dir][1]);
        uint8 frontRightValue = IMAGE_AT(image, x + Image_dir_frontRight[dir][0], y + Image_dir_frontRight[dir][1]);

        if (frontValue < localThres)
        {
            // 前方是黑色"墙壁" -- 向左转
            // 方向改变,记录转向一次
            // 向左转是 顺时针 - 所以要(+3)%4处理(或者说(-1)%4处理)
            dir = (dir + 3) % 4;
            ++turn;
        }
        else if (frontRightValue < localThres)
        {
            // 前方是白色,同时是右前方是"黑色" - 这种情况就是直道走
            x += Image_dir_front[dir][0];
            y += Image_dir_front[dir][1];
            Image_iptsRight[step][0] = x;
            Image_iptsRight[step][1] = y;
            ++step;
            turn = 0;
        }
        else
        {
            // 前方是白色,但是右前方也是"白色" - 这种情况下说明需要向右转弯"贴墙走"
            x += Image_dir_frontRight[dir][0];
            y += Image_dir_frontRight[dir][1];
            // 向右转是 顺时针 - 所以要(+1)%4处理
            dir = (dir + 1) % 4;
            Image_iptsRight[step][0] = x;
            Image_iptsRight[step][1] = y;
            ++step;
            turn = 0;
        }
    }
    Image_iptsRightNum = step;
}

/**
 * @brief               三角点集滤波
 * @param pts_in        需要滤波的曲线数组
 * @param lineNum       曲线的长度
 * @param pts_out       滤波输出
 * @param kernel        "三角形底边长"
 * @example
 */
void Image_BlurPoints(uint8 pts_in[][2], uint8 lineNum, uint8 pts_out[][2], uint8 kernerl)
{
    int8 half = kernerl / 2;
    uint16 tmpPtsOut[2];
    for (int i = 0; i < lineNum; ++i)
    {
        tmpPtsOut[0] = 0;
        tmpPtsOut[1] = 0;
        // 后面几个点就直接不用了
        for (int j = -half; j < half; ++j)
        {
            tmpPtsOut[0] += pts_in[bf_clip(i + j, 0, lineNum - 1)][0] * (half + 1 - abs(j));
            tmpPtsOut[1] += pts_in[bf_clip(i + j, 0, lineNum - 1)][1] * (half + 1 - abs(j));
        }
        pts_out[i][0] = tmpPtsOut[0] / ((2 * half + 2) * (half + 1) / 2);
        pts_out[i][1] = tmpPtsOut[1] / ((2 * half + 2) * (half + 1) / 2);
    }
}

/**
 * @brief               点集等距采样(是走过的采样前折线段的距离为dist)
 * @param pts_in        需要处理的线
 * @param num1          待处理线的长度
 * @param pts_out       数据输出数组
 * @param num2          输出数组长度限幅&输出线的长度
 * @param dist          实际距离(单位为m)
 * @example
 */
void Image_ResamplePoints(uint8 pts_in[][2], uint8 num1, uint8 pts_out[][2], uint8 *num2, float dist)
{
    float remain = 0;
    uint8 len = 0;
    for (uint8 i = 0; i < num1 - 1 && len < *num2; ++i)
    {
        uint8 x0 = pts_in[i][0];
        uint8 y0 = pts_in[i][1];
        float dx = (float)(pts_in[i + 1][0] - x0);
        float dy = (float)(pts_in[i + 1][1] - y0);
        float dn = sqrt(dx * dx + dy * dy);
        dx /= dn;
        dy /= dn;

        // 进行等距采样
        while (remain < dn && len < *num2)
        {
            x0 += (uint8)(dx * remain);
            pts_out[len][0] = x0;
            y0 += (uint8)(dy * remain);
            pts_out[len][1] = y0;

            ++len;
            dn -= remain;
            remain = dist;
        }
        remain -= dn;
    }
    *num2 = len;
}

/**
 * @brief               求解点集局部角度变化率
 * @param pts_in        需要处理的线
 * @param num           线的长度
 * @param angle_out     角度输出值
 * @param dist          角度采样的距离(点序数距离)
 * @formula             tan(x + y) = (tan(x) - tan(y)) / (1 + tan(x) * tan())
 */
void Image_LocalAnglePoints(uint8 pts_in[][2], uint8 num, float angle_out[], uint8 dist)
{
    for (uint8 i = 0; i < num; ++i)
    {
        if (i <= 0 || i >= num - 1)
        {
            // 线的边缘没有角度,进行处理设置为0
            angle_out[i] = 0;
            continue;
        }
        // 用向量的方法计算
        // 这个算的其实是对应的补角
        // 因为如果直接计算点为两个向量的起点的话,那么直线算出来的是180°,实际上想要的是0°
        float dx1 = pts_in[i][0] - pts_in[bf_clip(i - dist, 0, num - 1)][0];
        float dy1 = pts_in[i][1] - pts_in[bf_clip(i - dist, 0, num - 1)][1];
        float dn1 = sqrtf(dx1 * dx1 + dy1 * dy1);
        float dx2 = pts_in[bf_clip(i + dist, 0, num - 1)][0] - pts_in[i][0];
        float dy2 = pts_in[bf_clip(i + dist, 0, num - 1)][1] - pts_in[i][1];
        float dn2 = sqrtf(dx2 * dx2 + dy2 * dy2);
        float c1 = dx1 / dn1; // 学长的遗产，我也不知道为什么要用arctan   --linnuofan-2024/3/19
        float s1 = dy1 / dn1; // 现在好像明白了，不知道为什么acosf在单片机上有问题。。 --linnuofan-2024/3/22
        float c2 = dx2 / dn2;
        float s2 = dy2 / dn2;
        angle_out[i] = atan2f(c1 * s2 - c2 * s1, c2 * c1 + s2 * s1) * 180 / Image_PI;
        // angle_out[i] = acosf((dx1 * dx2 + dy1 * dy2) / (dn1 * dn2));
    }
}

/**
 * @brief               角度变化率非极大抑制(向两边搜索查看最值)
 * @param angle_in      所要处理的角度数组
 * @param num           线的长度
 * @param angle_out     角度输出(只保留区域化最值)
 * @param kernel        区块边长
 * @param cornerNum     角点个数
 * @example
 */
void Image_NmsAngle(float angle_in[], uint8 lineNum, float angle_out[], uint8 kernel, uint8 *cornerNum)
{
    int8 half = kernel / 2;
    *cornerNum = lineNum;
    for (uint8 i = 0; i < lineNum; ++i)
    {
        angle_out[i] = angle_in[i];
        for (int8 j = -half; j <= half; ++j)
        {
            if (fabs(angle_in[bf_clip(i + j, 0, lineNum - 1)]) > fabs(angle_out[i]))
            {
                angle_out[i] = 0;
                --(*cornerNum);
                break;
            }
        }
    }
}

/**
 * @brief 角点寻找
 *
 */
void Image_FindCorners(void)
{
    // 识别 Y,L拐点
    // 把角点判断置false
    Image_LptLeft_Found = false;
    Image_LptRight_Found = false;
    // 判断是否是直道
    // 如果边线没有超过0.5米,那就说明肯定不是直道了
    Image_isStraightLeft = Image_rptsLeftsNum > 0.5 / Image_sampleDist;
    Image_isStraightRight = Image_rptsRightsNum > 0.5 / Image_sampleDist;

    // 左边线判断 - 初始角点不参与判断
    for (uint8 i = 2; i < Image_rptsLeftsNum; ++i)
    {
        if (Image_rptsLeftan[i] == 0)
            continue;
        // 当检测到有角度的点然后去判断
        //uint8 im1 = (uint8)bf_clip(i - (uint8)round(Image_angleDist / Image_sampleDist), 0, Image_rptsLeftsNum - 1);
        //uint8 ip1 = (uint8)bf_clip(i + (uint8)round(Image_angleDist / Image_sampleDist), 0, Image_rptsLeftsNum - 1);
        float conf = fabs(Image_rptsLefta[i]);

        // L角点判断
        if (Image_LptLeft_Found == false && 65 < conf && 135 > conf && i < 0.7 / Image_sampleDist)
        {
            Image_LptLeft_rptsLefts_id = i;
            Image_LptLeft_Found = true;
        }
        // 长直道判断
        if (conf > 15.0 && i < 0.8 / Image_sampleDist)
        {
            Image_isStraightLeft = false;
        }

        // 找到一组后,退出
        if (Image_isStraightLeft == false && Image_LptLeft_Found == true)
            break;
    }

    // 右边线判断 - 初始角点不参与判断
    for (uint8 i = 2; i < Image_rptsRightsNum; ++i)
    {
        if (Image_rptsRightan[i] == 0.0)
            continue;
        // 当检测到有角度的点然后去判断
        //uint8 im1 = (uint8)bf_clip(i - (uint8)round(Image_angleDist / Image_sampleDist), 0, Image_rptsRightsNum - 1);
        //uint8 ip1 = (uint8)bf_clip(i + (uint8)round(Image_angleDist / Image_sampleDist), 0, Image_rptsRightsNum - 1);
        float conf = fabs(Image_rptsRighta[i]);

        // L角点判断
        if (Image_LptRight_Found == false && 65 < conf && 135 > conf && i < 0.7 / Image_sampleDist)
        {
            Image_LptRight_rptsRights_id = i;
            Image_LptRight_Found = true;
        }
        // 长直道判断
        if (conf > 15.0 && i < 0.8 / Image_sampleDist)
        {
            Image_isStraightRight = false;
        }

        // 找到一组后,退出
        if (Image_isStraightRight == false && Image_LptRight_Found == true)
            break;
    }
}

/**
 * @brief 获取边线终点到起点的向量与(1, 0)的夹角
 * 
 */
void Image_GetTurnAngle(void)
{
    float dx = (float)(Image_rptsLefts[0][0] - Image_rptsLefts[Image_rptsLeftsNum - 1][0]);
    float dy = (float)(Image_rptsLefts[0][1] - Image_rptsLefts[Image_rptsLeftsNum - 1][1]);
    Image_LeftTurnAngle = atan2f(dy, dx) * 180 / 3.1416;

    dx = (float)(Image_rptsRights[0][0] - Image_rptsRights[Image_rptsRightsNum - 1][0]);
    dy = (float)(Image_rptsRights[0][1] - Image_rptsRights[Image_rptsRightsNum - 1][1]);
    Image_RightTurnAngle = atan2f(dy, dx) * 180 / 3.1416;
}

/**
 * @brief 弯道方向判断
 *
 */
void Image_DirJudge(void)
{
    if (Image_LeftTurnAngle <= 90 - TURN_JUDGE_ANGLE)
        Image_LeftDir = 1;
    else if (Image_LeftTurnAngle >= 90 + TURN_JUDGE_ANGLE)
        Image_LeftDir = 2;
    else 
        Image_LeftDir = 0;

    if (Image_RightTurnAngle <= 90 - TURN_JUDGE_ANGLE)
        Image_RightDir = 1;
    else if (Image_RightTurnAngle >= 90 + TURN_JUDGE_ANGLE)
        Image_RightDir = 2;
    else 
        Image_RightDir = 0;
}

/**
 * @brief 边线截断
 * @note  于L角点处截断边线，防止小车沿直角边线巡出
 *
 */
void Image_LineCut(void)
{
    if (Image_LptLeft_Found == true)
        Image_rptsLeftsNum = Image_LptLeft_rptsLefts_id;
    if (Image_LptRight_Found == true)
        Image_rptsRightsNum = Image_LptRight_rptsRights_id;
}

/**
 * @brief                   左边线跟踪中线
 * @param pts_in            需要处理的边线数据
 * @param lineNum           边线的长度
 * @param pts_out           中线的输出数组
 * @param approx_num        求斜率的时候中点距离上点(下点)的像素点个数
 * @param dist              赛道的宽度
 * @example
 */
void Image_TrackLeftLine(uint8 pts_in[][2], uint8 num, uint8 pts_out[][2], uint8 approx_num, float dist)
{
    for (int i = 0; i < num; ++i)
    {
        float dx = (float)(pts_in[bf_clip(i + approx_num, 0, num - 1)][0] - pts_in[bf_clip(i - approx_num, 0, num - 1)][0]);
        float dy = (float)(pts_in[bf_clip(i + approx_num, 0, num - 1)][1] - pts_in[bf_clip(i - approx_num, 0, num - 1)][1]);
        float dn = sqrt(dx * dx + dy * dy);
        dx /= dn;
        dy /= dn;
        pts_out[i][0] = (uint8)((float)pts_in[i][0] - dy * dist);
        pts_out[i][1] = (uint8)((float)pts_in[i][1] + dx * dist);
    }
}

/**
 * @brief                   右边线跟踪中线
 * @param pts_in            需要处理的边线数据
 * @param lineNum           边线的长度
 * @param pts_out           中线的输出数组
 * @param approx_num        求斜率的时候中点距离上点(下点)的像素点个数
 * @param dist              赛道的宽度
 * @example
 */
void Image_TrackRightLine(uint8 pts_in[][2], uint8 num, uint8 pts_out[][2], uint8 approx_num, float dist)
{
    for (int i = 0; i < num; ++i)
    {
        float dx = (float)(pts_in[bf_clip(i + approx_num, 0, num - 1)][0] - pts_in[bf_clip(i - approx_num, 0, num - 1)][0]);
        float dy = (float)(pts_in[bf_clip(i + approx_num, 0, num - 1)][1] - pts_in[bf_clip(i - approx_num, 0, num - 1)][1]);
        float dn = sqrt(dx * dx + dy * dy);
        dx /= dn;
        dy /= dn;
        pts_out[i][0] = (uint8)((float)pts_in[i][0] + dy * dist);
        pts_out[i][1] = (uint8)((float)pts_in[i][1] - dx * dist);
    }
}

/**
 * @brief                   中线延长
 * @note                    在十字边线被截断时延长中线
 * @param Target_MidLineNum 目标中线长度（像素点个数）
 */
void Image_MidLine_Extend(uint8 Target_MidLineNum)
{
    // 若中线足够长，直接退出
    if (Image_MidLineNum >= Target_MidLineNum)
        return;
    float dx = 0;
    float dy = 0;
    // 逐差法延长中线
    uint8 dist = (uint8)bf_clip(Image_MidLineNum / 2, 1, 3);
    for (uint8 i = 0; i < dist; i++)
    {
        dx = dx + Image_MidLine[Image_MidLineNum - i][0] - Image_MidLine[Image_MidLineNum - 3 - i][0];
        dy = dy + Image_MidLine[Image_MidLineNum - i][1] - Image_MidLine[Image_MidLineNum - 3 - i][1];
    }
    dx /= dist * dist;
    dy /= dist * dist;
    for (uint8 i = Image_MidLineNum; i < Target_MidLineNum; i++)
    {
        Image_MidLine[i][0] = Image_MidLine[Image_MidLineNum][0] + dx * (i - Image_MidLineNum + 1);
        Image_MidLine[i][1] = Image_MidLine[Image_MidLineNum][1] + dy * (i - Image_MidLineNum + 1);
    }
    Image_MidLineNum = Target_MidLineNum;
}

/**
 * @brief               大津法 - 通过类间方差,计算图像进行二值化的阈值(计算的时候使用的平均数,不是加权平均数)
 * @param image         图像指针
 * @param imgHeight     图像的高度
 * @param imgWidth      图像的宽度
 * @return              处理后得到的阈值
 * @example             Image_threshold = Image_Processing_OtsuGetThresh(mt9v03x_image[0]);
 */
uint8 Image_Processing_OtsuGetThresh(const uint8 *image)
{
    gpio_set_level(P20_9, 0);
    // 返回出去的阈值
    uint8 threshold;

    // 8bit灰度值
    uint16 grayHistogram[256];

    // 最小灰度值
    uint8 minGrayValue;

    // 最大灰度值
    uint8 maxGrayValue;

    // 得到像素的总数
    uint16 numOfPix = IMAGE_HEIGHT * IMAGE_WIDTH;

    // 灰度值总值
    uint32 imgTotalGrayValue = 0;

    // 前景像素点数
    uint16 pixelOfFore = 0;
    // 背景像素点数
    uint16 pixelOfBack = 0;

    // 前景元素的占比
    float omegaFore = 0.0;
    // 背景元素的占比
    float omegaBack = 0.0;

    // 前景元素灰度值总值
    uint32 imgTotalGrayValueOfFore = 0;
    // 背景元素灰度值总值
    uint32 imgTotalGrayValueOfBack = 0;

    // 前景元素灰度平均数
    float miuFore = 0.0;
    // 背景元素灰度平均数
    float miuBack = 0.0;

    // 临时的方差
    float sigmaTmp = 0.0;

    // 保存了最大方差数据的方差
    float sigma = 0.0;

    // 初始化灰度直方图
    for (int i = 0; i < 256; ++i)
        grayHistogram[i] = 0;

    uint8 index = 0;

    // 梳理每个灰度级别中每个像素在整幅图中的个数
    for (uint8 i = 0; i < IMAGE_HEIGHT; ++i)
    {
        for (uint8 j = 0; j < IMAGE_WIDTH; ++j)
        {
            index = *(image + (i * IMAGE_WIDTH + j));
            ++grayHistogram[index];
        }
    }
    // 获取最小的灰度值
    for (minGrayValue = 0; minGrayValue < 256 && grayHistogram[minGrayValue] == 0; ++minGrayValue)
        ;

    // 获取最大的灰度值
    for (maxGrayValue = 255; maxGrayValue > minGrayValue && grayHistogram[maxGrayValue] == 0; --maxGrayValue)
        ;

    if (minGrayValue == maxGrayValue) // 只有一个颜色
        return minGrayValue;

    if (minGrayValue + 1 == maxGrayValue) // 只有两个颜色
        return minGrayValue;

    // 像素总数 和 灰度值总数
    for (uint8 i = minGrayValue; i < maxGrayValue; ++i)
    {
        imgTotalGrayValue += grayHistogram[i] * i;
    }

    // 进行二值化计算处理
    for (uint8 i = minGrayValue; i < maxGrayValue; ++i)
    {
        pixelOfFore += grayHistogram[i];      // 前景像素个数
        pixelOfBack = numOfPix - pixelOfFore; // 背景像素个数

        omegaFore = (float)pixelOfFore / (float)numOfPix; // 前景像素百分比
        omegaBack = 1 - omegaFore;                        // 背景像素百分比

        imgTotalGrayValueOfFore += grayHistogram[i] * i;                       // 前景像素灰度值
        imgTotalGrayValueOfBack = imgTotalGrayValue - imgTotalGrayValueOfFore; // 背景像素灰度值

        // 前景灰度平均数
        miuFore = (float)imgTotalGrayValueOfFore / (float)pixelOfFore; // 前景像素灰度平均数
        miuBack = (float)imgTotalGrayValueOfBack / (float)pixelOfBack; // 背景像素灰度平均数

        // 计算类间方差
        sigmaTmp = omegaFore * omegaBack * (miuFore - miuBack) * (miuFore - miuBack);
        if (sigmaTmp > sigma)
        {
            sigma = sigmaTmp;
            threshold = i;
        }
    }
    // gpio_set_level(P20_9, 1);
    return threshold;
}

/**
 * @brief               图像处理初始化 - 计算处理阈值
 * @attention           需要在摄像头初始化以后再调用该函数
 */
void Image_Init(void)
{
    // 系统延时一段时间,然后计算大津法
    system_delay_ms(100);
    while (1)
    {
        if (mt9v03x_finish_flag == 1)
        {
            ++Image_disPictureCnt;
            mt9v03x_finish_flag = 0;
            if (Image_disPictureCnt > Image_disPictureCnt_Thre)
            {
                Image_disPictureCnt = 0;
                break;
            }
        }
    }
    for (uint8 i = 0; i < Image_threCnt_Thre; ++i)
    {
        Image_threSum += Image_Processing_OtsuGetThresh(mt9v03x_image[0]);
    }
    image_thre = Image_threSum / Image_threCnt_Thre;
    Image_Init_flag = 1;
}

/**
 * @brief               图像处理,包括边缘提取,去畸变+逆透视,滤波,等距采样,计算角度,计算中线
 * @param image         需要处理的图片
 * @example             Image_Process(mt9v03x_image[0]);
 */
void Image_Process(uint8 *image)
{
    Image_Process_Status = 0;
    Image_LeftLine_Lost = 0;
    Image_RightLine_Lost = 0;

    //----------------------------------------
    // 原图找左右边线
    //----------------------------------------

    // 找左边线
    Image_iptsLeftNum = sizeof(Image_iptsLeft) / sizeof(Image_iptsLeft[0]);
    uint8 x1 = image_begin_x;
    uint8 y1 = image_begin_y;
    // 十字反向巡线
    if (CROSS_STATE == CROSS_RUNNING)
    {
        // 反向巡线模式，修改边线处理起始坐标
        x1 = IMAGE_WIDTH / 2;    // 边线处理的起始x坐标
        y1 = INVERTED_TRACING_Y; // 边线处理起始的y坐标
        for (; x1 > 0; --x1, --y1)
            if (IMAGE_AT(image, x1 - 1, y1) < image_thre)
                break; // 查找边界上的第一个点
    }
    else
    {
        for (; x1 > 0; --x1)
            if (IMAGE_AT(image, x1 - 1, y1) < image_thre)
                break; // 查找边界上的第一个点
    }
    if (IMAGE_AT(image, x1, y1) >= image_thre)
    { // 没有到边界就正常处理
        Image_FindLine_LeftHand_Adaptive(Image_iptsLeft, image, image_block_size, image_block_clip_value, x1, y1);
    }
    else
        Image_iptsLeftNum = 0; // 边界的话就是0了

    // 找右边线
    Image_iptsRightNum = sizeof(Image_iptsRight) / sizeof(Image_iptsRight[0]);
    uint8 x2 = image_begin_x;
    uint8 y2 = image_begin_y;
    // 十字反向巡线
    if (CROSS_STATE == CROSS_RUNNING)
    {
        // 斜向巡线模式，修改边线处理起始坐标
        x2 = IMAGE_WIDTH / 2;    // 边线处理的起始x坐标
        y2 = INVERTED_TRACING_Y; // 边线处理起始的y坐标
        for (; x2 < IMAGE_WIDTH - 1; ++x2, --y2)
            if (IMAGE_AT(image, x2 + 1, y2) < image_thre)
                break; // 查找边界上的第一个点
    }
    else
    {
        for (; x2 < IMAGE_WIDTH - 1; ++x2)
            if (IMAGE_AT(image, x2 + 1, y2) < image_thre)
                break; // 查找边界上的第一个点
    }
    if (IMAGE_AT(image, x2, y2) >= image_thre) // 没有到边界就正常处理
        Image_FindLine_RightHand_Adaptive(Image_iptsRight, image, image_block_size, image_block_clip_value, x2, y2);
    else
        Image_iptsRightNum = 0; // 边界的话就是0了

    //----------------------------------------
    // 图传、显示数据备份，避免图传、显示时总线冲突
    if (Image_show_NE == 0)
    {
        Image_iptsLeftNum_Bak = Image_iptsLeftNum;
        Image_iptsRightNum_Bak = Image_iptsRightNum;
        Image_rptsLeftsNum_Bak = Image_rptsLeftsNum;
        Image_rptsRightsNum_Bak = Image_rptsRightsNum;
        for (uint8 i = 0; i < Image_iptsLeftNum; ++i)
        {
            LeftLine_raw_show[0][i] = Image_iptsLeft_Bak[i][0] = Image_iptsLeft[i][0];
            LeftLine_raw_show[1][i] = Image_iptsLeft_Bak[i][1] = Image_iptsLeft[i][1];
            RightLine_raw_show[0][i] = Image_iptsRight_Bak[i][0] = Image_iptsRight[i][0];
            RightLine_raw_show[1][i] = Image_iptsRight_Bak[i][1] = Image_iptsRight[i][1];
        }
        for (uint8 i = 0; i < Image_rptsLeftsNum; ++i)
        {
            LeftLine_show[0][i] = Image_rptsLefts_Bak[i][0] = Image_rptsLefts[i][0];
            LeftLine_show[1][i] = Image_rptsLefts_Bak[i][1] = Image_rptsLefts[i][1];
        }
        for (uint8 i = 0; i < Image_rptsRightsNum; ++i)
        {
            RightLine_show[0][i] = Image_rptsRights_Bak[i][0] = Image_rptsRights[i][0];
            RightLine_show[1][i] = Image_rptsRights_Bak[i][1] = Image_rptsRights[i][1];
        }

        for (uint8 i = 0; i < Image_rptsLeftsNum; ++i)
        {
            MidLine_show[0][i] = Image_RsMidLine[i][0];
            MidLine_show[1][i] = Image_RsMidLine[i][1];
        }
        Image_show_NE = 1;
    }
    //----------------------------------------
    // 对边线进行去畸变 + 逆透视变换
    for (uint8 i = 0; i < Image_iptsLeftNum; ++i)
    {
        Image_rptsLeft[i][0] = map_x[Image_iptsLeft[i][1]][Image_iptsLeft[i][0]];
        Image_rptsLeft[i][1] = map_y[Image_iptsLeft[i][1]][Image_iptsLeft[i][0]];
    }
    Image_rptsLeftNum = Image_iptsLeftNum;

    for (uint8 i = 0; i < Image_iptsRightNum; ++i)
    {
        Image_rptsRight[i][0] = map_x[Image_iptsRight[i][1]][Image_iptsRight[i][0]];
        Image_rptsRight[i][1] = map_y[Image_iptsRight[i][1]][Image_iptsRight[i][0]];
    }
    Image_rptsRightNum = Image_iptsRightNum;
    // 没有变换表，先不变换了，兼容一下
    // for (uint8 i = 0; i < Image_iptsLeftNum; ++i) {
    //     Lboundary_trans[0][i] = Image_rptsLeft[i][0] = Image_iptsLeft[i][0];
    //     Rboundary_trans[1][i] = Image_rptsLeft[i][1] = Image_iptsLeft[i][1];
    // }
    // Image_rptsLeftNum = Image_iptsLeftNum;
    //
    // for (uint8 i = 0; i < Image_iptsRightNum; ++i) {
    //    Image_rptsRight[i][0] = Image_iptsRight[i][0];
    //    Image_rptsRight[i][1] = Image_iptsRight[i][1];
    //}
    // Image_rptsRightNum = Image_iptsRightNum;

    //-------------------------------------
    // 去除(0,0)点（出于逆透视变换等原因变成(0, 0)的异常的点）
    for (uint8 i = 0; i < Image_rptsLeftNum; ++i)
    {
        uint8 j = 0;
        if (Image_rptsLeft[i][0] != 0 || Image_rptsLeft[i][1] != 0)
        {
            Image_rptsLeft[i - j][0] = Image_rptsLeft[i][0];
            Image_rptsLeft[i - j][1] = Image_rptsLeft[i][1];
            ++Image_rptsLeftrNum;
        }
        else
            j++;
    }
    Image_rptsLeftNum = Image_rptsLeftrNum;
    Image_rptsLeftrNum = 0;

    for (uint8 i = 0; i < Image_rptsRightNum; ++i)
    {
        uint8 j = 0;
        if (Image_rptsRight[i][0] != 0 || Image_rptsRight[i][1] != 0)
        {
            Image_rptsRight[i - j][0] = Image_rptsRight[i][0];
            Image_rptsRight[i - j][1] = Image_rptsRight[i][1];
            ++Image_rptsRightrNum;
        }
        else
            j++;
    }
    Image_rptsRightNum = Image_rptsRightrNum;
    Image_rptsRightrNum = 0;
    //----------------------------------------
    // 对数据进行三角滤波
    // 左边线
    Image_BlurPoints(Image_rptsLeft, Image_rptsLeftNum, Image_rptsLeftb, Image_linerBlurKernel);
    Image_rptsLeftbNum = Image_rptsLeftNum;
    // 右边线
    Image_BlurPoints(Image_rptsRight, Image_rptsRightNum, Image_rptsRightb, Image_linerBlurKernel);
    Image_rptsRightbNum = Image_rptsRightNum;

    //----------------------------------------
    // 对滤波后数据进行等距采样
    Image_rptsLeftsNum = sizeof(Image_rptsLefts) / sizeof(Image_rptsLefts[0]);
    Image_ResamplePoints(Image_rptsLeftb, Image_rptsLeftbNum, Image_rptsLefts, &Image_rptsLeftsNum, Image_sampleDist * Image_pixelPreMeter);
    Image_rptsRightsNum = sizeof(Image_rptsRights) / sizeof(Image_rptsRights[0]);
    Image_ResamplePoints(Image_rptsRightb, Image_rptsRightbNum, Image_rptsRights, &Image_rptsRightsNum, Image_sampleDist * Image_pixelPreMeter);

    // 判断边线是否丢失
    if (Image_rptsLeftsNum <= 6)
        Image_LeftLine_Lost = 1;
    if (Image_rptsRightsNum <= 6)
        Image_RightLine_Lost = 1;

    //----------------------------------------
    // 求解边线局部角度变化率
    Image_LocalAnglePoints(Image_rptsLefts, Image_rptsLeftsNum, Image_rptsLefta, (uint8)round(Image_angleDist / Image_sampleDist));
    Image_LocalAnglePoints(Image_rptsRights, Image_rptsRightsNum, Image_rptsRighta, (uint8)round(Image_angleDist / Image_sampleDist));

    //----------------------------------------
    // 对角度变化率进行非极大抑制(只保留一段边线中数据最大的点)
    Image_NmsAngle(Image_rptsLefta, Image_rptsLeftsNum, Image_rptsLeftan, (uint8)round(Image_angleDist / Image_sampleDist) * 2 + 1, &Image_cornerNumLeft);
    Image_NmsAngle(Image_rptsRighta, Image_rptsRightsNum, Image_rptsRightan, (uint8)round(Image_angleDist / Image_sampleDist) * 2 + 1, &Image_cornerNumRight);

    // 寻找角点
    Image_FindCorners();

    // 在L角点处截断边线，防止巡出十字
    Image_LineCut();

    // 判断弯道
    Image_GetTurnAngle();
    Image_DirJudge();

    // 状态机检测
    State_Check();

    //---------------------------------------
    // 中线跟踪，当TRACE_TYPE == TRACE_NONE时保留上一状态
    if (TRACE_TYPE == TRACE_LEFT_MIDLINE)
    {
        Image_TrackLeftLine(Image_rptsLefts, Image_rptsLeftsNum, Image_MidLine, 4, Image_pixelPreMeter * Image_roadWidth / 2);
        Image_MidLineNum = Image_rptsLeftsNum;
    }
    else if (TRACE_TYPE == TRACE_RIGHT_MIDLINE)
    {
        Image_TrackRightLine(Image_rptsRights, Image_rptsRightsNum, Image_MidLine, 4, Image_pixelPreMeter * Image_roadWidth / 2);
        Image_MidLineNum = Image_rptsRightsNum;
    }
    // 对中线进行等距采样
    if (TRACE_TYPE != TRACE_NONE)
    {
        Image_ResamplePoints(Image_MidLine, Image_MidLineNum, Image_RsMidLine, &Image_MidLineNum, Image_sampleDist * Image_pixelPreMeter);

        if (Image_isUsefulData_Status == 0)
        {
            Image_isUsefulData_Status = 1;
        }
        // 延长中线
        if (CROSS_STATE == CROSS_ENTER)
        {
            // Image_MidLine_Extend(30);
        }
    }

    Image_Process_Status = 1;
}